import React from "react";
// import Data from "./Data";

const Card = () => {
  let data = {
    id: 1,
    name: "sourav",
    age: 22,
    state: "odisha",
  };
  return (
    <>
      <div className="row">
        <h1 className="col-3">{data.id}</h1>
        <h1 className="col-3">{data.name}</h1>
        <h1 className="col-3">{data.age}</h1>
        <h1>{data.state}</h1>
      </div>
    </>
  );
};

export default Card;
